import * as React from 'react';
import LinearProgress, { linearProgressClasses } from '@mui/material/LinearProgress';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Stack from '@mui/material/Stack';
import { useTheme } from '@mui/material/styles';
import MobileStepper from '@mui/material/MobileStepper';
import Stepper from '@mui/material/Stepper';
import Step from '@mui/material/Step';
import StepLabel from '@mui/material/StepLabel';
import KeyboardArrowLeft from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRight from '@mui/icons-material/KeyboardArrowRight';
import {Link} from "react-router-dom";

function Survey() {
  const theme = useTheme();
  const [activeStep, setActiveStep] = React.useState(0);

  const handleNext = () => {
  setActiveStep((prevActiveStep) => prevActiveStep + 1);
  };

  const handleBack = () => {
  setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  const steps = ['Select campaign settings', 'Create an ad group', 'Create an ad'];

    const renderStep = () => {
      let content = null;
      switch (activeStep) {
          case 0:
            content = (
                <div className="p-8">
                    <div className="m-8">이미지를 만들기 전에, 몇가지 질문을 시작합니다.</div>
                </div>
            );
            break;
          case 1:
            content = (
              <div className="p-lr-8">
                  <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="브랜드명 입력" variant="standard" />
                    </Box>
                    <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">확인</Button>
                  </Stack>
              </div>
            );
            break;
          case 2:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="브랜드명 의미 입력" variant="standard" />
                    </Box>
                    <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">확인</Button>
                  </Stack>
                </div>
              );
            break;
          case 3:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="업종 입력" variant="standard" />
                    </Box>
                    <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">확인</Button>
                  </Stack>
                </div>
              );
            break;
          case 4:
            content = (
              <div className="p-lr-8">
                  <Stack direction="row">
                  <Box
                    component="form"
                    sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                    noValidate
                    autoComplete="off">
                    <TextField id="standard-basic" label="관련 비즈니스 입력" variant="standard" />
                  </Box>
                  <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">확인</Button>
                </Stack>
              </div>
            );
          break;
          case 5:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="원하는 로고 분위기" variant="standard" />
                    </Box>
                    <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">확인</Button>
                  </Stack>
                </div>
              );
            break;
          case 6:
            content = (
              <div className="p-8">
                <div className="m-8">원하는 스타일을 선택해주세요!</div>
                  <Stack direction="row">
                  <Button className="surveyBt" variant="contained" color="babyblue">완료!</Button>
                </Stack>
              </div>
            );
          break;
        default:
          content = <div>Error</div>;
          break;
      }
      return content;
    };

  return (
    /*<div className="parent">
        <div className="child">
            <div className="survey text-center">
                <div className="progress-div">
                <MobileStepper
                    variant="progress"
                    steps={7}
                    position="static"
                    activeStep={activeStep}
                    sx={{ flexGrow: 1 }}
                    nextButton={
                      <Button size="small" onClick={handleNext} disabled={activeStep === 6}>
                        Next
                        {theme.direction === 'rtl' ? (
                          <KeyboardArrowLeft />
                        ) : (
                          <KeyboardArrowRight />
                        )}
                      </Button>
                    }
                    backButton={
                      <Button size="small" onClick={handleBack} disabled={activeStep === 0}>
                        {theme.direction === 'rtl' ? (
                          <KeyboardArrowRight />
                        ) : (
                          <KeyboardArrowLeft />
                        )}
                        Back
                      </Button>
                    }
                  />
                </div>
                <div className="content-div">
                    {renderStep()}
                </div>
                <div className="button-div">
                    <Link to={"/Survey"}>
                        <Button className="startBt f-right" variant="contained" color="pupleblue">START</Button>
                    </Link>
                </div>
            </div>
        </div>
    </div>*/
      <div className="parent">
          <div className="child">
              <div className="survey text-center">
                  <div className="progress-div">

                  </div>
                  <div className="content-div">
                      {renderStep()}
                  </div>
                  <div className="button-div">
                      <Link to={"/Survey"}>
                          <Button className="startBt f-right" variant="contained" color="pupleblue">START</Button>
                      </Link>
                  </div>
              </div>
          </div>
      </div>
  );
}

export default Survey;
